import React from "react";
import { Image, ImageBackground } from "react-native";
import { Text } from "react-native";

export default function Images({images} : any) {
    let imagesComp : Array<Element> = []

    for(let i=0; i<images.length; i++) {
        imagesComp.push(<Image source={images[0]}/>)
    }

    imagesComp.map((img : Element) => {
        console.log('Ready to render')
        console.log(img)
        return <><ImageBackground source={images[0]} width={100} height={100}><Text style={{backgroundColor: 'blue'}}>JUST A TEST</Text></ImageBackground></>
    })
    return <>{imagesComp[0]}</>;
}
